import React,{ Component } from 'react';

class Login extends Component {
    render(){
        return (
            <div className="App">
              <h1>Login User</h1>

              <label>
                  UserName:
                  <input type="text" name="username" />
              </label>
              <label>
                  PassWord:
                  <input type="password" name="password" />
              </label>
            </div>
        );
    }
}

export default Login;
